import React from 'react';
import Signup from './components/Signup';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Your App</h1>
      </header>
      <main>
        <Signup />
      </main>
    </div>
  );
};

export default App;
